"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[923],{7601:(l,i,e)=>{e.r(i),e.d(i,{data:()=>a});const a={key:"v-621d7523",path:"/Back-end/Web%E6%B5%8B%E8%AF%95%E4%BA%8EApp%E6%B5%8B%E8%AF%95.html",title:"Web测试于App测试",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"描述用浏览器访问www.baidu.com的过程?",slug:"描述用浏览器访问www-baidu-com的过程",children:[]},{level:2,title:"测试界面上一个输入框，输入信息后点击保存，你怎样确定是服务端问题还是端问题?",slug:"测试界面上一个输入框-输入信息后点击保存-你怎样确定是服务端问题还是端问题",children:[]},{level:2,title:"如何测试购买下单和退货流程",slug:"如何测试购买下单和退货流程",children:[]},{level:2,title:"什么是sql注入，什么是跨站脚本，什么是跨站请求伪造?",slug:"什么是sql注入-什么是跨站脚本-什么是跨站请求伪造",children:[]},{level:2,title:"给你一个网站怎么开展测试?",slug:"给你一个网站怎么开展测试",children:[]},{level:2,title:"电商支付模块的测试如何开展？",slug:"电商支付模块的测试如何开展",children:[]},{level:2,title:"如何开展兼容性测试?",slug:"如何开展兼容性测试",children:[]},{level:2,title:"nginx,tomcat,apache都是什么?",slug:"nginx-tomcat-apache都是什么",children:[]},{level:2,title:"apache和nginx的区别?",slug:"apache和nginx的区别",children:[]},{level:2,title:"Selenium有哪些定位元素方法",slug:"selenium有哪些定位元素方法",children:[]},{level:2,title:"简述Android四大组件及生命周期?",slug:"简述android四大组件及生命周期",children:[]},{level:2,title:"APP测试的内容主要包括哪些，如何开展?",slug:"app测试的内容主要包括哪些-如何开展",children:[]},{level:2,title:"Android的兼容性测试都考虑哪些内容?",slug:"android的兼容性测试都考虑哪些内容",children:[]},{level:2,title:"朋友圈点赞，如何设计测试用例?",slug:"朋友圈点赞-如何设计测试用例",children:[]},{level:2,title:"在查看logcat命令日志时候怎么内容保存到本地文件",slug:"在查看logcat命令日志时候怎么内容保存到本地文件",children:[]},{level:2,title:"App崩溃(闪退)，可能是什么原因导致的?",slug:"app崩溃-闪退-可能是什么原因导致的",children:[]},{level:2,title:"如何测试监测app的内存使用、CPU消耗、流量使用情况?",slug:"如何测试监测app的内存使用、cpu消耗、流量使用情况",children:[]},{level:2,title:"如何定位APP上的元素，使用appium的inspector了吗，用什么平台做的",slug:"如何定位app上的元素-使用appium的inspector了吗-用什么平台做的",children:[]}],filePathRelative:"Back-end/Web测试于App测试.md",git:{updatedTime:null,contributors:[]}}},9617:(l,i,e)=>{e.r(i),e.d(i,{default:()=>t});const a=(0,e(6252).uE)('<h1 id="web测试于app测试" tabindex="-1"><a class="header-anchor" href="#web测试于app测试" aria-hidden="true">#</a> Web测试于App测试</h1><h2 id="描述用浏览器访问www-baidu-com的过程" tabindex="-1"><a class="header-anchor" href="#描述用浏览器访问www-baidu-com的过程" aria-hidden="true">#</a> 描述用浏览器访问www.baidu.com的过程?</h2><ul><li>浏览器向DNS服务器发出解析域名的请求</li><li>DNS服务器将“www.baidu.com”域名解析为对应的IP地址，并返回给浏览器</li><li>浏览器于百度服务器进行三次握手，建立TCP连接</li><li>浏览器发出HTTP请求报文</li><li>服务器回复HTTP响应报文</li><li>浏览器解析响应报文，渲染HTML内容，并显示在页面上</li><li>收发报文结束，释放TCP连接，执行四次挥手</li></ul><h2 id="测试界面上一个输入框-输入信息后点击保存-你怎样确定是服务端问题还是端问题" tabindex="-1"><a class="header-anchor" href="#测试界面上一个输入框-输入信息后点击保存-你怎样确定是服务端问题还是端问题" aria-hidden="true">#</a> 测试界面上一个输入框，输入信息后点击保存，你怎样确定是服务端问题还是端问题?</h2><blockquote><p>通过网络调试工具对前后端问题进行定位：例如 通过抓包工具没有抓到数据包可以考虑是前段问题 能够抓到通信数据包就可以查看下HTTP状态码 4xx （客户端问题） 5xx服务端问题</p></blockquote><h2 id="如何测试购买下单和退货流程" tabindex="-1"><a class="header-anchor" href="#如何测试购买下单和退货流程" aria-hidden="true">#</a> 如何测试购买下单和退货流程</h2><blockquote><ul><li><p>用户下单后，取消订单</p></li><li><p>下单后，一直不付款，检查订单超时不付款的场景下，会不会自动取消订单</p></li><li><p>在订单快超时的，付款</p></li><li><p>下单后，在不同的终端登录，一端取消订单，同时一端对该订单进行付款</p></li><li><p>弱网状态下，多次点击提交订单按钮，检查是否会生成多个订单</p></li><li><p>用户付款后，申请退款，买家端的订单状态为退款申请中，卖家端显示为退款审核；申请退款通过后，订单状态为已关闭状态，买家收到退还的金额；卖家拒绝退款，订单状态为待发货状态；卖家超时不处理退款申请，自动退款，订单自动设置为已退款状态，买家收到退还的金额</p></li><li><p>买家收货后，买家申请退款/退货，买家端的订单状态为退款申请中，卖家端显示退款审核；申请退款通过后，订单状态为已关闭状态，买家收到退还的金额；卖家拒绝退款/退货，订单状态为已确认收货状态；卖家超时不处理退款/退货申请，自动退款，订单自动设置为已退款状态，买家收到退还的金额</p></li></ul></blockquote><h2 id="什么是sql注入-什么是跨站脚本-什么是跨站请求伪造" tabindex="-1"><a class="header-anchor" href="#什么是sql注入-什么是跨站脚本-什么是跨站请求伪造" aria-hidden="true">#</a> 什么是sql注入，什么是跨站脚本，什么是跨站请求伪造?</h2><blockquote><p>什么是SQL注入：</p><ul><li>SQL注入就是通过SQL命令插入到Web表单递交或输入域名或页面请求的查询字符串，最终达到欺骗服务器执行恶意的SQL命令。</li></ul><p>XSS跨站脚本：</p><ul><li>浏览器错误的将攻击者提供的用户输入数据当作JS脚本给执行了，窃取包括用户身份信息在内部的各种敏感信息、修改web网页以欺骗用户，设置控制受害者的浏览器，或者和其他漏洞结合起来形成蠕虫攻击</li></ul><p>CSRF跨站请求伪造：</p><ul><li>浏览器发出违背用户意愿的请求，伪造请求，例如转发微博，添加管理员，修改资料等。</li><li>黑客通过网站B，诱使用户去访问已登录的网站A，进行一些违背用户意愿的请求，造成用户损失。</li></ul></blockquote><h2 id="给你一个网站怎么开展测试" tabindex="-1"><a class="header-anchor" href="#给你一个网站怎么开展测试" aria-hidden="true">#</a> 给你一个网站怎么开展测试?</h2><blockquote><ul><li>首先，查找需求说明、网站设计等相关文档，分析测试需求</li><li>指定测试计划，确定测试范围和测试策略，一般包括以下几部分：功能性测试，界面测试，性能测试，数据库测试，安全性测试，兼容性测试</li><li>设计测试用例 <ul><li>功能性能测试可以包括，但不限于以下几个方面：链接测试（链接是否正确跳转，是否存在空页面和无效页面，是否有不正确的出错信息返回等）；提交功能测试（多媒体元素是否可以正确加载和显示）；多语言支持是否能够正确显示选择的语言等。</li><li>界面测试可以包括但不限于以下几个方面：页面是否风格统一，美观。页面布局是否合理，重点内容和热点内容是否突出。空间是否正常使用。对于必须但为安安装的空间，是否提供自动下载并安装的功能，文字检查。</li><li>性能测试一般从以下两个方面考虑：压力测试，负载测试，强度测试</li><li>数据库测试要具体决定是否需要开展。数据库一般考虑连结性，对数据的存取操作，数据内容的验证等方面。</li><li>安全性测试：基本的登录功能的检查；是否存在溢出错误，导致系统崩溃或者权限泄漏</li><li>兼容性测试，根据需求说明的内容，确定支持的平台组合；浏览器的兼容版本；操作系统的兼容性；软件平台的兼容性；数据库的兼容性</li></ul></li><li>开展测试，并记录缺陷。合理的安排调整测试进度，提前获取测试所需的资源，建立管理体系</li><li>定期评审，对测试进行评估和总结，调整测试的内容</li></ul></blockquote><h2 id="电商支付模块的测试如何开展" tabindex="-1"><a class="header-anchor" href="#电商支付模块的测试如何开展" aria-hidden="true">#</a> 电商支付模块的测试如何开展？</h2><blockquote><ul><li>点击支付--&gt;选择支付方式--&gt;确认金额--&gt;输入密码--&gt;成功支付--&gt;</li><li>功能测试 <ul><li>边界值、等价类、错误推测</li></ul></li><li>接口测试 <ul><li>明确整个支付流程所需哟的调用接口，分清楚商家和第三方平台的接口以及参数的请求方式，包括对接口特定参数的加密，使用异常订单号模拟支付，对服务端的检验等等</li></ul></li><li>安全测试 <ul><li>支付都会涉及到金额，那么就需要安全测试这个方面，支付请求的伪造，金额的恶意篡改，恶意模拟第三方接口来调用商家接口等</li></ul></li><li>测试点 <ul><li>付款金额和应付金额是否一致</li><li>同一种支付方式，不同的支付入口</li><li>支付成功后，产品购买是否成功</li><li>支付成功后，用户的金额是否扣除成功</li></ul></li><li>支付金额测试点 <ul><li>正常金额支付</li><li>金额的最小值：0.01</li><li>无意义的值：0元</li><li>最大金额：这是金额的最大金额</li><li>银行卡或微信等，设置每日最大消费金额或者单笔最大消费金额</li><li>银行卡或微信余额不足时支付</li></ul></li><li>支付流程测试点 <ul><li>正常完成支付流程</li><li>调起订单后，取消订单</li><li>支付中断后，继续支付</li><li>支付后终端后结束支付</li><li>单笔订单单笔支付</li><li>多订单合并支付</li><li>持续点击支付，是否会出现多次购买</li></ul></li><li>支付方式测试点 <ul><li>支付宝支付</li><li>支付宝网页支付</li><li>微信支付</li><li>银行卡支付</li></ul></li></ul></blockquote><h2 id="如何开展兼容性测试" tabindex="-1"><a class="header-anchor" href="#如何开展兼容性测试" aria-hidden="true">#</a> 如何开展兼容性测试?</h2><blockquote><p>测试程序在不同浏览器上是否可以正常运行，功能是否正常使用</p><p>屏幕尺寸和分辨率兼容测试：测试程序在不同的分辨率下能否正常显示</p><p>操作系统兼容测试：测试程序在不同的操作系统下面能否正常运行，功能是否正常使用，显示是否正确等</p><p>首先开展人工测试，看看主流程和主界面是否有问题，如果存在问题，那么记录下bug情况，以及浏览器型号和版本，以及操作系统，准确定位bug产生的原因，一觉bug，告知开发人员修改。</p></blockquote><h2 id="nginx-tomcat-apache都是什么" tabindex="-1"><a class="header-anchor" href="#nginx-tomcat-apache都是什么" aria-hidden="true">#</a> nginx,tomcat,apache都是什么?</h2><blockquote><p>Nginx常用做静态内容服务和代理服务器，直接外来请求转发给后面的应用服务器，</p><p>Tomcat一个应用容器</p><p>Nginx：正向代理反向代理</p></blockquote><h2 id="apache和nginx的区别" tabindex="-1"><a class="header-anchor" href="#apache和nginx的区别" aria-hidden="true">#</a> apache和nginx的区别?</h2><blockquote><p>apache是同步多进程模型：一个连接对应一个进程</p><p>nginx是异步的，多个连接可以对应一个进程</p><ul><li>适用场景 <ul><li>一般来说，需要性能web服务，用Nginx；如果不需要性能只求稳定，更考虑Apache</li><li>Nginx处理放静态内容比Apache更好，特别是可承受压力、贷款及资源消耗上都优于Apache</li><li>所以更为通用的方案是，前段Nginx抗并发，后端Apache集群，配合起来更好</li></ul></li></ul></blockquote><h2 id="selenium有哪些定位元素方法" tabindex="-1"><a class="header-anchor" href="#selenium有哪些定位元素方法" aria-hidden="true">#</a> Selenium有哪些定位元素方法</h2><blockquote><p>ID定位</p><p>name定位</p><p>class name定位</p><p>tag name定位</p><p>link_text和partial_link_text定位</p><p>css定位</p><p>xpath定位</p></blockquote><h1 id="app测试" tabindex="-1"><a class="header-anchor" href="#app测试" aria-hidden="true">#</a> App测试</h1><h2 id="简述android四大组件及生命周期" tabindex="-1"><a class="header-anchor" href="#简述android四大组件及生命周期" aria-hidden="true">#</a> 简述Android四大组件及生命周期?</h2><blockquote><p>Activity</p><ul><li>整个应用中负责于用户交互的组件，简单来说是程序的界面由他控制</li></ul><p>Services</p><ul><li>位于后台执行，为其他组件提供后台服务或监控其他组件的运行状态</li></ul><p>BroadcastReceiver</p><ul><li>广播消息接收器，类似事件编程中的监听器</li></ul><p>ContentProvider</p><ul><li>负责存储数据，允许有需要的应用程序访问数据，相当于一个图书馆</li></ul></blockquote><h2 id="app测试的内容主要包括哪些-如何开展" tabindex="-1"><a class="header-anchor" href="#app测试的内容主要包括哪些-如何开展" aria-hidden="true">#</a> APP测试的内容主要包括哪些，如何开展?</h2><blockquote><p>功能测试：</p><ul><li>业务逻辑正确性测试：依据：产品文档--&gt;测试用例编写</li></ul><p>兼容性测试：</p><ul><li>系统版本：Android官方版本，定制版本</li><li>分辨率：720 * 1280 1080* 1920</li><li>网络情况：2g 3g 4g 5g Wi-Fi</li></ul><p>异常测试：</p><ul><li>热启动应用：应用在后台长时间待机：应用在后台待机过程中，手机重启</li><li>网络切换和中断恢复：网络切换；中断恢复</li><li>电话信息终端恢复</li></ul><p>升级，安装，卸载测试：</p><ul><li>升级测试：临近版本升级；跨版本</li><li>安装测试：首次安装；覆盖安装；卸载后安装</li><li>卸载测试：首次卸载；卸载安装后在卸载</li></ul><p>健壮性测试：</p><ul><li>手机资源消耗：cpu、内存</li><li>流量消耗：图片、数据、视频</li><li>电量测试</li><li>崩溃恢复</li></ul></blockquote><h2 id="android的兼容性测试都考虑哪些内容" tabindex="-1"><a class="header-anchor" href="#android的兼容性测试都考虑哪些内容" aria-hidden="true">#</a> Android的兼容性测试都考虑哪些内容?</h2><blockquote><ul><li>品牌机型兼容</li><li>ROM兼容</li><li>屏幕兼容</li><li>软件兼容</li><li>版本兼容</li><li>网络兼容</li></ul></blockquote><h2 id="朋友圈点赞-如何设计测试用例" tabindex="-1"><a class="header-anchor" href="#朋友圈点赞-如何设计测试用例" aria-hidden="true">#</a> 朋友圈点赞，如何设计测试用例?</h2><blockquote><p>功能测试</p><ul><li>点赞后是否显示结果</li><li>点赞后是否可以取消</li><li>点赞取消后是否可以重复点赞</li><li>共同好友点赞后，是否有消息提醒</li><li>非共同好友点赞后，是否有消息提醒</li><li>点击点赞人昵称，是否可以跳转到ta的主页</li><li>自己能否给自己点赞</li><li>屏蔽了该用户，功能好友点赞是否提示</li><li>点赞人有备注时，是否展示备注昵称</li><li>点赞后删除好友，是否继续展示其点赞</li></ul><p>UI界面测试</p><ul><li>界面是否简介美观</li><li>点赞后动态特效是否正常显示</li><li>朋友圈界面图片是否正常显示</li><li>朋友圈界面文字是否正常显示</li></ul><p>性能测试</p><ul><li>点赞人数过多是否能正常显示</li><li>同一时间点赞人数过多是否正常收到提示</li></ul><p>安全性测试</p><ul><li>发送部分可见的朋友圈，其余人不可见</li><li>发送部分可见的朋友圈，点赞后共同好友不可见</li></ul><p>弱网测试</p><ul><li>弱网环境下，点赞是否成功</li><li>弱网环境下，点赞的时间</li></ul><p>易用性测试</p><ul><li>发送部分可见，是否可以沿用上次的名单</li></ul></blockquote><h2 id="在查看logcat命令日志时候怎么内容保存到本地文件" tabindex="-1"><a class="header-anchor" href="#在查看logcat命令日志时候怎么内容保存到本地文件" aria-hidden="true">#</a> 在查看logcat命令日志时候怎么内容保存到本地文件</h2><blockquote><p>adb shell logcat &gt; c:\\XX.txt</p></blockquote><h2 id="app崩溃-闪退-可能是什么原因导致的" tabindex="-1"><a class="header-anchor" href="#app崩溃-闪退-可能是什么原因导致的" aria-hidden="true">#</a> App崩溃(闪退)，可能是什么原因导致的?</h2><ul><li>缓存垃圾过多：由于手机系统的特性，如果长时间不清理垃圾文件，会导致越来越卡，也会出现闪退情况</li><li>运行的程序过多，导致内存不足</li><li>应用版本兼容问题：如果应用版本太低，会导致不兼容，造成闪退</li><li>App的sdk和手机的系统是否兼容</li></ul><h2 id="如何测试监测app的内存使用、cpu消耗、流量使用情况" tabindex="-1"><a class="header-anchor" href="#如何测试监测app的内存使用、cpu消耗、流量使用情况" aria-hidden="true">#</a> 如何测试监测app的内存使用、CPU消耗、流量使用情况?</h2><blockquote><p>perfdog 腾讯软件 不过已经收费了</p></blockquote><h2 id="如何定位app上的元素-使用appium的inspector了吗-用什么平台做的" tabindex="-1"><a class="header-anchor" href="#如何定位app上的元素-使用appium的inspector了吗-用什么平台做的" aria-hidden="true">#</a> 如何定位APP上的元素，使用appium的inspector了吗，用什么平台做的</h2><blockquote><p>xpath</p><p>text</p><p>id</p><p>name</p><p>class_name</p></blockquote>',38),p={},t=(0,e(3744).Z)(p,[["render",function(l,i){return a}]])}}]);